import React from 'react';
import Slider from 'react-slick';

const Carousel = () => {
  const settings = {
    dots: false,
    infinity: true,
    autoplay: true,
    speed: 500,
  };

  return (
    <div
      className='carrousel_wrapper'
      style={{ height: `${window.innerHeight}px` }}
    >
      <Slider {...settings}>
        <div>1</div>
        <div>2</div>
        <div>3</div>
      </Slider>
    </div>
  );
};

export default Carousel;
